import React from "react";
import { useFormik } from "formik";
import "../styles/Createcookie.css";
import { Link } from "react-router-dom";

const initialValues = {
  messageTitle: "",
  messageContent: "",
};

const onSubmit = (values) => {
  console.log("Form data", values);
};

const validate = (values) => {
  let errors = {};

  if (!values.messageTitle) {
    errors.messageTitle = "Required";
  }
  return errors;
};

function Createcookie() {
  const formik = useFormik({
    initialValues,
    onSubmit,
    validate,
  });

  return (
    <>
      <div className="maincreatecookie">
        <div></div>
        <form>
          <label htmlFor="messageTitle">Message Title</label>
          <input
            type="text"
            id="messageTitle"
            name="messageTitle"
            onChange={formik.handleChange}
            value={formik.values.messageTitle}
          />
          {formik.errors.messageTitle ? (
            <div className="error">Required</div>
          ) : null}
          <button type="submit">Create</button>
        </form>
        <Link to="/shelf"> To your shelf! </Link>
      </div>
    </>
  );
}

export default Createcookie;
